import React, { Component } from 'react';
import './App.css';
import Movie from './Movie';

const movies = [
  "Matrix",
  "Full Metal Jacker",
  "OldBoy",
  "Star Wars"
];

class App extends Component {
  render() {
    return (
      <div className="app">
        <Movie title={movies[0]} />
        <Movie title={movies[1]} />
        <Movie title={movies[2]} />
        <Movie title={movies[3]} />
      </div>
    );
  }
}

export default App;
